import React, { useState, useEffect } from 'react';
import { useSelector, useDispatch } from 'react-redux'
import { setName } from '../../store/action.js'

export function NameApp(){
    const dispatch = useDispatch()
    const names = useSelector(state => state.nameModule.names)
    // const { selectedName } = useSelector(state => state.nameModule)
    const selectedName = useSelector(state => state.nameModule.selectedName)
    useEffect(() => {
        dispatch(setName('bb'))
    }, [])
    return (
        <div>
            <p>name app</p>
            <p>{names}</p>
            <p>{selectedName}</p>
        </div>
    )
}
